 $(".logins").click(function(){
  $(".log").addClass("hide");
  $(".sign").removeClass("hide");
  $(".sign").addClass("active");
  $(".loginf").removeClass("hide");
  $(".loginf").addClass("active");
  $(".signf").addClass("hide");
  $(".signf").removeClass("active");
});

$(".signup").click(function(){
    $(".log").addClass("active");
    $(".log").removeClass("hide");
    $(".sign").addClass("hide");
    $(".signf").removeClass("hide");
    $(".signf").addClass("active");
    $(".loginf").addClass("hide");
    $(".loginf").removeClass("active");
  });


  $('.count').each(function () {
    $(this).prop('Counter',0).animate({
        Counter: $(this).text()
    }, {
        duration: 2500,
        easing: 'linear',
        step: function (now) {
            $(this).text(Math.ceil(now));
        }
    });
});

